import React from 'react'
import Logo from '../assets/logo.png'
import {FaBars, Fattimes} from 'react-icons/fa'

const Navbar = () => {
  return (
    <div className='fixed w-full h-[80px] flex justify-between item-center px-4 bg-[#A087BC] text-slate-900'>Navbar
        <div>
            <img src="{Logo} alt={}" />
        </div>
    </div>
  )
}

export default Navbar
